import { Fragment } from "react";
import { Outlet, Link } from "react-router-dom"

const Navigation = () => {
    return (
      <Fragment>
        <div className="navigation">
         <div>Logo</div>
         <div className="nav-links-container"></div>
         <Link className="nav-link" to="/home">
            home
         </Link>
        </div>
        <Outlet />
      </Fragment>
    )
  }

  export default Navigation;
